const ENDPOINT = "http://localhost:4003/db/users/6302c54cde4c0d027c831749"

export default function GetFavs({ jwt  }) {
    return fetch(`${ENDPOINT}`, {
      method: "GET",
      headers: {
        //"Authorization": jwt,
        "Content-Type": "application/json",
      }})
      .then((res) => {
        if (!res.ok) throw new Error("Response is NOT ok");
        return res.json();
      })
      .then((res) => {
        const { gifs} = res;
        console.log('',gifs)
        return gifs;
      });
  }
